import { Link } from 'react-router-dom';


function ShelterItem({ shelter: {id, name, city, avatar, contact, phone, email}}) {
    return(
        <div className="card profile-card-3">
                <div className="background-block">
                    <img src="https://images.pexels.com/photos/459225/pexels-photo-459225.jpeg?auto=compress&cs=tinysrgb&h=650&w=940" alt="profile-sample1" className="background"/>
                </div>
                <div className="profile-thumb-block">
                    <img src="https://randomuser.me/api/portraits/men/41.jpg" alt="profile-image" className="profile"/>
                </div>
                <div className="card-content">
                <h4>Justin Mccoy<small>Designer</small></h4>
                <div className="icon-block"><Link to="#"><i className="fa fa-facebook"></i></Link><Link to="#"> <i className="fa fa-twitter"></i></Link><Link to="#"> <i class="fa fa-google-plus"></i></Link></div>
                </div>
        </div>
        
    );
}

export default ShelterItem;
